import React from 'react';
import {Row,Col,Container} from 'reactstrap';
import Menu from './Menus';
import Home from'./Home';
const Section=()=>{
    return(
       <Container>
          <Row>

              <Col md="4">

             <Menu/>
               </Col>

               <Col md="8">
              <Home/>
                </Col>

      </Row>
      </Container>
    )
}
export default Section;
